import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { CustomerInvoiceAddComponent } from './customerInvoicesapp/customer-invoice-add/customer-invoice-add.component';
import { CustomerInvoicesListComponent } from './customerInvoicesapp/customer-invoices-list/customer-invoices-list.component';

const routes: Routes = [

  { path: 'add-customer', component: CustomerInvoiceAddComponent },

  { path: 'list-customer', component: CustomerInvoicesListComponent },

  { path: '', redirectTo: '/add-customer', pathMatch: 'full' }

];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
